import React from "react";

export const ResultStatistics = ({ gameStats, setShowResults, resetGame }) => {
  return (
    <>
      <div className="resultStats absolute z-10">{gameStats.guessResult}</div>
      <button
        className="newGameButton absolute z-20"
        onClick={() => {
          setShowResults(false);
        }}
      >
        close
      </button>
    </>
  );
};
export default ResultStatistics;
